package br.poli.ecomp.geav.nhe.model.db.cmp;import br.poli.ecomp.geav.nhe.model.db.Table;import br.poli.ecomp.geav.nhe.model.db.pro.IProject;	public class Composition extends Table implements IComposition{	private int cmp_identificador;	private IProject pro_componente;	private IProject pro_projeto;	private int cmp_atual;		public Composition()	{	}		@Override	public int get_cmp_atual() {		return this.cmp_atual;	}	@Override	public int get_cmp_identificador() {		return this.cmp_identificador;	}	@Override	public IProject get_pro_componente() {		return this.pro_componente;	}	@Override	public IProject get_pro_projeto() {		return this.pro_projeto;	}	@Override	public void set_cmp_atual(int value) {		this.cmp_atual = value;			}	@Override	public void set_cmp_identificador(int value) {		this.cmp_identificador = value;			}	@Override	public void set_pro_componente(IProject value) {		this.pro_componente = value;			}	@Override	public void set_pro_projeto(IProject value) {		this.pro_projeto = value;			}}
